input = new Scanner(System.in)
KB kb = new KB()
N = input.nextInt()
for (i = 0; i < N; ++i) {
	s1 = input.next()
	s2 = input.next()
	s3 = input.next()

	if (s1.equals("?")) {
		tmp = s1
		s1 = s2
		s2 = tmp
	}

	def mixSign13 = {c1, c3 ->
		def list = []
		if (c1 == '+') {
			if (c3 == '+') {
				list.add("+");
				list.add("-");
			} else if (c3 == '-') {
				list.add("+");
				list.add("-");
			}
		} else if (c1 == '-') {
			if (c3 == '+') {
				list.add("+");
			} else if (c3 == '-') {
				list.add("+");
				list.add("-");
			}
		}
		return list;
	}

	def mixSign12 = {c1, c2 ->
		def list = []
		if (c1 == '+') {
			if (c2 == '+') {
				list.add("+");
				list.add("-");
			} else if (c2 == '-') {
				list.add("+");
				list.add("-");
			}
		} else if (c1 == '-') {
			if (c2 == '+') {
				list.add("+");
				list.add("-");
			} else if (c2 == '-') {
				list.add("-");
			}
		}
		return list;
	}

	def getAnsStr = {List optList ->
		if (optList.isEmpty()) return "impossible";
		return optList.toString().replace("[", "").replace("]", "").replaceAll(",", "").trim();
	}

	def applySigns = {List types, List signs ->
		def list = []
		signs.each {si -> types.each { ty -> list.add(ty + si) }}
		list.sort()
		return list
	}

	def process = {String s1, String s2, String s3 ->
		def types
		def signs
		def optList

		if (s3.equals("?")) {
			types = kb.findBy12(s1.substring(0, s1.length() - 1), s2.substring(0, s2.length() - 1));
			signs = mixSign12(s1.charAt(s1.length() - 1), s2.charAt(s2.length() - 1));
			optList = applySigns(types, signs);
		}
		else if (s2.equals("?")) {
			types = kb.findBy13(s1.substring(0, s1.length() - 1), s3.substring(0, s3.length() - 1));
			signs = mixSign13(s1.charAt(s1.length() - 1), s3.charAt(s3.length() - 1));
			optList = applySigns(types, signs);
		}

		return getAnsStr(optList)
	}

	println process(s1, s2, s3)

}

class Formula {
	String s1
	String s2
	def list = []

	public Formula(String s1, String s2, List list) {
		this.s1 = s1
		this.s2 = s2
		this.list = list
	}
}

class KB {
	def fArr = []

	public KB() {
		fArr.add(new Formula("A", "A", ["A", "O"]))
		fArr.add(new Formula("A", "B", ["A", "B", "AB", "O"]))
		fArr.add(new Formula("A", "AB", ["A", "B", "AB"]))
		fArr.add(new Formula("A", "O", ["A", "O"]))
		fArr.add(new Formula("B", "A", ["A", "B", "AB", "O"]))
		fArr.add(new Formula("B", "B", ["B", "O"]))
		fArr.add(new Formula("B", "AB", ["A", "B", "AB"]))
		fArr.add(new Formula("B", "O", ["B", "O"]))
		fArr.add(new Formula("AB", "A", ["A", "B", "AB"]))
		fArr.add(new Formula("AB", "B", ["A", "B", "AB"]))
		fArr.add(new Formula("AB", "AB", ["A", "B", "AB"]))
		fArr.add(new Formula("AB", "O", ["A", "B"]))
		fArr.add(new Formula("O", "A", ["A", "O"]))
		fArr.add(new Formula("O", "B", ["B", "O"]))
		fArr.add(new Formula("O", "AB", ["A", "B"]))
		fArr.add(new Formula("O", "O", ["O"]))
	}

	public List findBy12(String s1, String s2) {
		for (Formula f : fArr) {
			if (f.s1.equals(s1) && f.s2.equals(s2))	return f.list
		}
		return null
	}

	public List findBy13(String s1, String s3) {
		def list = []
		for (Formula f : fArr) {
			if (f.s1.equals(s1) && f.list.contains(s3)) list.add(f.s2)
		}
		return list
	}
}
